operations.content:
mutation AddTweet($data: tweets_tweetsCreateInput!) {
  tweets_createOnetweets(data: $data) {
    id
    displayName
    username
    verified
    text
    avatar
    image
    date
  }
}

query Tweets {
  tweets_findManytweets {
    id
    displayName
    username
    verified
    text
    avatar
    image
    date
  }
}

